import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './pages/Home';
import SignUp from './pages/SignUp';
import SignIn from './pages/SignIn';
import Vocabulary from './pages/Vocabulary';
import EditProfile from './pages/EditProfile';
axios.defaults.baseURL = 'http://localhost:3001'; // Adjust this to your server's URL

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/signup" element={<SignUp />} />
        <Route path="/signin" element={<SignIn />} /> {/* Add SignIn route */}
        <Route path="/vocabulary" element={<Vocabulary />} /> {/* Add SignIn route */}
        <Route path="/edit-profile/:userId" element={<EditProfile />} /> {/* Ensure this is defined */}
      </Routes>
    </Router>
  );
}

export default App;
